import React, { Component } from 'react'

export default class HomeWork extends Component {

    state = {
        boxLeft: [
            {
                label: "Davlatshoh",
                bool: false
            },
            {
                label: "Dilshoh",
                bool: false
            },
            {
                label: "Daler",
                bool: false
            },
            {
                label: "Davron",
                bool: false
            },
        ],

        boxRight: []
    }


    render() {
        return (
            <div>
                <div>
                    {
                        this.state.boxLeft.map((item, index) => <>
                        <label htmlFor="">{item.label}</label>
                        <input type="submit" checked={item.bool} onChange={this.Fill} />
                        </>)
                    }
                </div>
            </div>
        )
    }
}
